INSERT INTO `email_template` (`id`, `title`, `subject`, `slug`, `template`, `created_at`, `updated_at`)
VALUES
	(1,'Email Activation','Hello [user_name], Please Activate your [app_name] account!','user.email_activation','<h1>Halo, [user_name]!</h1>\r\n<p>You receiving this email because you are registered on <a href=\"[app_url]\">[app_name]</a></p>\r\n<p>To Activate your account, Please simply click button below.</p>\r\n<p>&nbsp;</p>\r\n<p>[button url=activate_account]</p>\r\n<p>&nbsp;</p>\r\n<p>Thanks!, [app_name]</p>','2018-01-04 19:31:00','2018-01-08 13:07:37'),
	(2,'Reset Password','Hi [user_name], Reset your [app_name] Account Password!','user.reset_password','<h1>Hi, [user_name]</h1>\r\n<p>You received this email because you are requesting password reset at</p>\r\n<p>[app_name]</p>\r\n<p>You just need to click button below!</p>\r\n<p>[button url=reset_password]</p>\r\n<p>Thanks!</p>\r\n<p>[app_name]</p>','2018-01-20 03:13:15','2018-01-20 03:40:16'),
	(3,'Order Confirmed','Thanks for your order at [app_name]! - [order_id]','order.status.order_confirmed','<h1>Hi, [user_name]!</h1>\r\n<p>Thank you for your order on [app_name] at [order_date]!</p>\r\n<p>Here are the details of your order :&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>[order details=order_details_table]</p>\r\n<p>&nbsp;</p>\r\n<p>Thanks!</p>\r\n<p>[app_name]</p>','2018-02-07 17:23:09','2018-02-12 00:13:22'),
	(4,'Order Status Changed','Hi [user_name]! Your order status has been updated! - [order_id]','order.status_changed','<h1>Hi [user_name]!</h1>\r\n<p>Your order with id&nbsp;<strong>[order_id]&nbsp;</strong>status&nbsp;has been updated by admin!</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">[order_status]</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\">We\'ll let you know if your order status has been updated again!</p>\r\n<p style=\"text-align: left;\">Thanks!</p>\r\n<p style=\"text-align: left;\">[app_name].</p>\r\n<p style=\"text-align: left;\">&nbsp;</p>','2018-02-08 19:04:49','2018-02-12 00:10:41'),
	(5,'Order has been Paid!','[user_name], Your order has been paid!','order.status.paid','<h1>Order Paid! #[order_id]</h1>\r\n<p>Hi [user_name], Your order with order id #[order_id] has been paid!</p>\r\n<p>We will inform you about your order that you placed at [order_date] has been paid successfully!</p>\r\n<p>Here is the details :</p>\r\n<p>&nbsp;</p>\r\n<p>[order_details_table]</p>\r\n<p>&nbsp;</p>\r\n<p>You can also check all your order by accessing your order page by clicking the button below!</p>\r\n<p>[button url=account_dashboard_order]</p>\r\n<p>&nbsp;</p>\r\n<p>And also we attached the invoice of your order!</p>\r\n<p>Thanks!</p>\r\n<p>[app_name]</p>','2018-02-08 20:10:08','2018-02-08 20:10:08'),
	(6,'Order has been Shipped!','Hi [user_name], Congratulations! Your order has been shipped!','order.status.shipped','<h3>[user_name], your order has been shipped to [order details=shipping_address_street].</h3>\r\n<p>Below is detail of your shipment :</p>\r\n<p>&nbsp;</p>\r\n<p><strong>Estimated delivery:&nbsp;[order details=shipping_estimated_delivery]</strong></p>\r\n<p>Tracking number:&nbsp;<strong>[order details=shipping_tracking_number]</strong></p>\r\n<p>Shipping Courier:&nbsp;<strong>[order details=shipping_courier]</strong></p>\r\n<p>Order Id:&nbsp;<strong>[order_id]</strong></p>\r\n<p>&nbsp;</p>\r\n<p>Thank you for your order!</p>\r\n<p>[app_name]</p>','2018-02-08 20:19:13','2018-02-12 00:08:57'),
	(7,'Order Payment Confirmed!','Hi [user_name], Payment Confirmed! - [order_id]','order.status.payment_confirmed','<h1>Payment Confirmed for [order_id]</h1>\r\n<p>Hi [user_name], We will inform you about your payment, it\'s been confirmed!</p>\r\n<p>Here are the payment details :</p>\r\n<p>&nbsp;</p>\r\n<p>Order Id: <strong>[order_id]</strong></p>\r\n<p>Order Date:&nbsp;<strong>[order_date]</strong></p>\r\n<p>Payment Method:&nbsp;<strong>[order details=payment_method]</strong></p>\r\n<p>&nbsp;</p>\r\n<p>We will ship your order ASAP!</p>\r\n<p>Thanks!</p>\r\n<p>[app_name]</p>','2018-02-08 20:24:08','2018-02-12 18:11:52');
